def factorical(n: int):
    if n == 1 or 0:
        return 1
    return factorical(n - 1) * n


class MST:

    def __init__(self, coordinate: np.array=None, grap:np.array = None):

        if coordinate:
            self.coordinate = coordinate

            def distance_(x1: list, x2: list):  # Calculate the Euler distance between two points
                return pow(pow(x1[0] - x2[0], 2) + pow(x1[1] - x2[1], 2), 0.5)

            self.matrix_size = [len(coordinate) for _ in range(2)]

            def fill_value(y1, x1, values):
                self.dis_matrix[y1, x1] = values if not y1 == x1 else np.inf

            self.dis_matrix: np.array = np.zeros(self.matrix_size)
            self.best_path: list = []

            [[fill_value(j, i, distance_(a[i], a[j])) for j in range(self.matrix_size[0])] for i in
             range(self.matrix_size[0])]  # Generate distance matrix

            '''
            Just as:
                for i in range(range(self.matrix_size[0])):
                    for j in range(i):
                        if not i==j:
                            dis_matrix[j, i] = distance_(templatetags[i], templatetags[j])
            '''
        else:
            self.dis_matrix = grap
            self.matrix_size = grap.shape

    def Prim(self)->list:

        def minimum_coordinate(y_index: int) -> int:
            next_vertex = np.argmin(matrix_copy, axis=0)[y_index]
            matrix_copy[:, y_index] = np.inf
            matrix_copy[y_index, :] = np.inf
            return next_vertex

        U_list: list = []  # To recode the vertex who has minimum distance

        matrix_copy = deepcopy(self.dis_matrix)

        next_vertex: int = -1

        while len(U_list) < self.matrix_size[0]:
            print(next_vertex)

            if not U_list:  # 第一次搜索整个矩阵的最小值

                '''
                np.argmin() 将二维数组转化为1维度后再索引最小值，
                故最小值的列索引：index // 矩阵列数
                故最小值的行索引：index % 矩阵列数
                '''

                Y_index = np.argmin(matrix_copy) // self.matrix_size[0]  # 代表下一个点
                X_index = np.argmin(matrix_copy) % self.matrix_size[0]  # 代表初始点

                U_list.append(X_index)  # 添加到U_list

                matrix_copy[:, X_index] = np.inf  # 将这个点到其他所有顶点的距离置为inf，相当于将这个点从顶点集合中移除
                matrix_copy[X_index, :] = np.inf
                next_vertex = Y_index

            else:
                U_list.append(next_vertex)
                next_vertex = minimum_coordinate(next_vertex)

        self.best_distance = sum([self.dis_matrix[U_list[i], U_list[i + 1]] for i in range(len(U_list) - 1)])
        self.best_path = U_list
        return U_list

    def Kruskal(self)->list:

        self.matrix_copy = deepcopy(self.dis_matrix) #复制距离矩阵
        print(self.matrix_copy)
        self.selected_edge: list = [] #记录已经选择的边
        self.hr_check:bool = False
        def check_hr(new, old):
            for i in new:
                if i not in [old[0], old[-1]]:
                    self.hr_check = False
                    return
            self.hr_check = True

        def choice_minimum_edge() -> list: #选择距离矩阵最短的一条边，返回两个节点

            vertex_1 = np.argmin(self.matrix_copy) // self.matrix_size[0]  # Column
            vertex_2 = np.argmin(self.matrix_copy) % self.matrix_size[0]  # Row
            self.matrix_copy[vertex_1, vertex_2], self.matrix_copy[vertex_2, vertex_1] = np.inf, np.inf
            print(np.min(self.matrix_copy), [vertex_1, vertex_2], 'templatetags')
            return [vertex_1, vertex_2]


        while np.min(self.matrix_copy) < np.inf:  #将新边加入集合，并链接可以链接的边
            new_edge: list = choice_minimum_edge()

            flag = []
            if len(self.selected_edge) >= 1:
                for i in range(len(self.selected_edge)):
                    check_hr(new_edge, self.selected_edge[i])
                    if self.hr_check:
                        break
                    for j in range(len(new_edge)):
                        print(new_edge[j], self.selected_edge[i], 'k')
                        if new_edge[j] == self.selected_edge[i][0]:

                            self.selected_edge[i] = [new_edge[j - 1]] + self.selected_edge[i]
                            # 在距离矩阵置0
                            self.matrix_copy[:, new_edge[j - 1]], self.matrix_copy[new_edge[j - 1], :] = np.inf, np.inf
                            self.matrix_copy[:, self.selected_edge[i][0]], self.matrix_copy[self.selected_edge[i][0], :] = np.inf, np.inf
                            flag.append([i, 0])
                            break


                        elif new_edge[j] == self.selected_edge[i][-1]:
                            # 在距离矩阵置0
                            print('R')
                            self.matrix_copy[:, new_edge[j - 1]], self.matrix_copy[new_edge[j - 1], :] = np.inf, np.inf
                            self.matrix_copy[:, self.selected_edge[i][-1]], self.matrix_copy[self.selected_edge[i][-1], :] = np.inf, np.inf
                            self.selected_edge[i] = self.selected_edge[i] + [new_edge[j - 1]]
                            flag.append([i, -1])
                            break


                if len(flag) == 0 and not self.hr_check:

                    self.selected_edge.append(new_edge)
                # 如果两个边可以链接
                if len(flag) == 2:
                    # print(self.selected_edge)
                    print('o',flag)
                    print(self.selected_edge, new_edge)
                    print(self.selected_edge[flag[0][0]], self.selected_edge[flag[1][0]])
                    head = self.selected_edge[flag[0][0]] if flag[0][-1]== -1 else self.selected_edge[flag[-1][0]]
                    rear = self.selected_edge[flag[0][0]] if flag[0][-1] == 0 else self.selected_edge[flag[-1][0]]
                    self.selected_edge[flag[0][0]] = head[:-1] + rear[1:]
                    self.selected_edge.remove(self.selected_edge[flag[-1][0]])
                print(self.matrix_copy)
                print(self.hr_check)
                print(self.selected_edge, new_edge)
                print('<-->')
                print()

            else:
                if not self.hr_check:
                    print('this')
                    self.selected_edge.append(new_edge)
        return self.selected_edge



    def show_path(self) -> None:
        path_coordinate = [self.coordinate[i] for i in self.best_path]
        start_end_x = [path_coordinate[0][0], path_coordinate[-1][0]]
        start_end_y = [path_coordinate[0][1], path_coordinate[-1][1]]
        x, y = [i[0] for i in path_coordinate], [i[1] for i in path_coordinate]
        plt.plot(x, y, marker='o')
        plt.plot(start_end_x, start_end_y, marker='o', color='red')
        plt.show()


